import React, {useContext} from 'react';
import './Homepage.css';
import userContext from './userContext';
import {Link} from 'react-router-dom';




function HomeAnon() {


  return (

            <div className="home-button-container">
                        <h1 className="mb-4 font-weight-bold">Jobly</h1>
        <p className="homepageP2">All the jobs in one, convenient place.</p>
              <Link className="home-button btn btn-primary font-weight-bold mr-3"
                to="/login">Log in
              </Link>
              <Link className="home-button btn btn-primary font-weight-bold"
                to="/signup">Sign Up</Link> 
            </div>
          )}


export default HomeAnon;
